INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (1, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 2, 40011, 1, 125801, 321, 0, "リリ", 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (1, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 40011, 1, 126001, 322, 0, "クリア", 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (1, 3, "んーと。\nこれ、あげる。\nはい", 2, 40011, 1, 126101, 323, 0, "プレシア", 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (2, 4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 40011, 1, 125801, 324, 0, "リリ", 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (2, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 40011, 1, 126001, 325, 0, "クリア", 24001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (2, 6, "お兄。\nきてくれて、うれしい", 2, 40011, 1, 126101, 326, 0, "プレシア", 24001);
